import React from "react";
import {createUseStyles} from "react-jss";

const useStyles = createUseStyles({
  card: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-around",
    borderRadius: "5px",
    border: "2px solid rgba(53, 59, 64, 0.66)",
    boxShadow: "5px 5px 10px gray",
    width: "max-content",
    maxWidth: "350px",
    height: "min-content",
    margin: "10px"
  },
  cardText: {
    flexGrow: "1",
    wordWrap: "break-word",
    textAlign: "center"
  },
  num: {
    flexGrow: "1",
    wordWrap: "break-word",
    textAlign: "center"
  },
  fibNum: {
    flexGrow: "1",
    wordWrap: "break-word",
    textAlign: "center"
  },
  date: {
    composes: "$cardText",
    textAlign: "right",
    fontStyle: "oblique",
    color: "rgba(20, 23, 94, 0.8)"
  }
});

function ReqCard(props) {
  const classes = useStyles();
  return (
    <React.Fragment>
      <div className={classes.card}>
        <div className={classes.cardText}>requested num - {props.num} </div>
        <div className={classes.cardText}>result - {props.fibNum} </div>
        <div className={classes.date}>
          {" "}
          date -{" "}
          {(() => {
            let date = new Date(Date.parse(props.date));
            return date.toDateString();
          })()}
        </div>
      </div>
    </React.Fragment>
  );
}

export default ReqCard;
